.source.js-semantic {
  color: #333333;
  background-color: transparent;
  font-style: normal;
  font-weight: normal;
  text-decoration: none;
}
.source.js-semantic.identifier.color-index-1 {
  color: #806000;
}
.source.js-semantic.identifier.color-index-2 {
  color: #408000;
}
.source.js-semantic.identifier.color-index-3 {
  color: #008020;
}
.source.js-semantic.identifier.color-index-4 {
  color: #007f80;
}
.source.js-semantic.identifier.color-index-5 {
  color: #002080;
}
.source.js-semantic.identifier.color-index-6 {
  color: #400080;
}
.source.js-semantic.identifier.color-index-7 {
  color: #800060;
}
.source.js-semantic.identifier.color-index-8 {
  color: #800000;
}
.source.js-semantic.comment {
  color: #999999;
}
.source.js-semantic.keyword {
  font-weight: bold;
}
.source.js-semantic.number {
  color: #000000;
}
.source.js-semantic.string,
.source.js-semantic.regex {
  color: #dd1144;
}
